import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class AddTaskForm extends React.Component {
  render() {
    return (
      <Container fluid = {true} style = {{marginTop: "100px", backgroundColor: "#F0F0F0", height: "100px", display: "flex", justifyContent: "center", textAlign: "center"}}>
          <Row>
            <Col lg = {3}>
                Time
            </Col>
            <Col lg = {7}>
                Add Task Input Text
            </Col>
            <Col lg = {2}>
                Button
            </Col>
          </Row>
      </Container>
);}}

export default AddTaskForm;
